import { Component } from 'react';
import './Search.css'
import PropTypes from "prop-types";

class Search extends Component {
    constructor(props) {
        super(props);
        this.handleChange = this.handleChange.bind(this);
    }

    static propTypes = {
        onChange: PropTypes.func
    };

    static defaultProps = {
        onChange: () => { }
    }

    handleChange(event) {
        const onChange = this.props.onChange;
        onChange(event);
    }

    render() {
        return (
            <div class="Search">
                <div class = "InputWrapper">
                    <input class="SearchInput" placeholder="Player Search" onChange={this.handleChange}/>
                </div>
                <br></br>
                <div class = "SelectWrapper">
                    <select class="StatSelect">
                        <option value="" disabled selected>Select Stat</option>
                        <option value="pts">PTS</option>
                        <option value="min">MIN</option>
                        <option value="fgm">FGM</option>
                        <option value="fg3m">3PM</option>
                        <option value="ftm">FTM</option>
                        <option value="reb">REB</option>
                        <option value="ast">AST</option>
                        <option value="stl">STL</option>
                        <option value="blk">BLK</option>
                        <option value="turnover">TOV</option>
                        <option value="fg_pct">FG%</option>
                        <option value="fg3_pct">3P%</option>
                        <option value="ft_pct">FT%</option>
                    </select>
                </div>
            </div>
        );
    }
}

export default Search;
